import { ReactComponent as Logo } from '../assets/react-logo.svg'


function NavBar() {
    return (
      <div className="container">
        <span>
         <Logo width="30px" />
        </span>
        <span>my travel journal</span>
      </div>

    )
}

export default NavBar
